    struct Vault {
        string vaultId;
        bool exists;
    }

    struct Transactions {
        address token;
        address sender;
        address recipient;
        uint256 amount;
    }
    uint256 public vaultCount;
    uint256 public transactionCount;

    string public signPrefix = "Signed for Vault Multisig:";

    mapping(address => mapping(address => uint256)) public tokens; //mapping of token addresses to mapping of account balances
    mapping(uint256 => Transactions) transactions;
    mapping(string => uint256) public metadata;
    mapping(uint256 => mapping(string => Vault)) private vault;
    mapping(address => mapping(address => bool)) private signers; 
    mapping(address => uint256) private numberOfSigners;
    mapping(address => uint256) private countSigners;

    event VaultCreated(uint256 indexed userId, string indexed vaultId);
    event Deposit(address token, address indexed sender, uint256 amount);
    event Withdraw(address token, address indexed sender, uint256 amount);
    event TransferSuccessful(
        address indexed token,
        address indexed sender,
        address indexed recipient,
        uint256 amount
    );
    event TransferFailed(
        address token,
        address indexed sender,
        address indexed recipient,
        uint256 amount
    );
    event signerAdded(address vaultAddress, address[] signerAddresses, uint256 maxSigners);

    function mintId(string memory email) internal pure returns (uint256) {
        bytes memory emailBytes = bytes(email);
        return uint256(keccak256(emailBytes));
    }
    function checkEmail(string memory email) internal returns (uint256) {
        uint256 userId = mintId(email);
        //check if the user's email is mapped already
        if (metadata[email] != 0) {
            return metadata[email];
        } else {
            metadata[email] = userId;
            return userId;
        }
    }

    function create(string memory email, string memory vaultId)
        public
        returns (bool)
    {
        bool exists = true;
        uint256 userId = checkEmail(email);
        require(!vault[userId][vaultId].exists, "Vault already exists");
        vault[userId][vaultId] = Vault(vaultId, exists);
        vaultCount++;
        emit VaultCreated(userId, vaultId);
        return true;
    }

    function prefixedHash(
        address signerAddress
    ) public view returns(bytes32) {
        bytes32 hash = keccak256(
          abi.encodePacked(
            signPrefix,
            address(this),
            signerAddress)
        );
        return hash;
    }

//     function signTransaction(address vaultAddress, address signerAddress) external returns (bool) {
//     //   require(!usedNonces[nonce], "nonce cannot be reused");
//     //   usedNonces[nonce] = true;
//     require(signers[vaultAddress][signerAddress] == true, "You don't have this permission");
//     countSigners[vaultAddress]++;
//     return true;
//   }

  function checkSigner(address signerAddress) public view returns (bool){
      return signers[msg.sender][signerAddress];
  }

  function addSigners(address[] memory signerAddresses, uint256 maxSigners) public returns(bool) {
    for (uint i=0; i<signerAddresses.length; i++) {
          signers[msg.sender][signerAddresses[i]] = true;
      }
      numberOfSigners[msg.sender] = maxSigners;
      emit signerAdded(msg.sender, signerAddresses, maxSigners);
      return true;
  }

  function isSignatureValid(
        address signerAddress,
        uint8 v,
        bytes32 r,
        bytes32 s
        ) public view returns (bool correct) {
        require(signers[msg.sender][signerAddress] == true, "You don't have this permission");
        bytes32 mustBeSigned = prefixedHash(signerAddress);
        address signer = ecrecover(
            mustBeSigned,
            v, r, s
        );
        // countSigners[msg.sender]++;
        return (signer == signerAddress);
    }

  function transferTokenMulti(
        address token,
        address recipient,
        uint256 value,
        uint256 countedSigners
    ) public whenNotPaused returns (bool) {
        address sender = msg.sender;
        require(numberOfSigners[sender] == countedSigners, "The number of signers is not fulfilled");
        if (value > Token(token).allowance(sender, address(this))) {
            emit TransferFailed(token, sender, recipient, value);
            revert(
                "Value of tokens to transfer cannot be greater than approved token value"
            );
        }
        Token(token).transferFrom(sender, recipient, value);
        countSigners[sender] = 0;
        emit TransferSuccessful(token, sender, recipient, value);
        return true;
    }

    function transferToken(
        string memory email,
        address token,
        address recipient,
        uint256 value
    ) public whenNotPaused returns (bool) {
        address sender = _msgSender();
        if (value > Token(token).allowance(sender, address(this))) {
            emit TransferFailed(token, sender, recipient, value);
            revert(
                "Value of tokens to transfer cannot be greater than approved token value"
            );
        }
        uint256 userId = checkEmail(email);
        Token(token).transferFrom(sender, recipient, value);
        transactions[userId] = Transactions(token, sender, recipient, value);
        transactionCount++;
        emit TransferSuccessful(token, sender, recipient, value);
        return true;
    }

    function balanceOf(address token, address vaultAddress)
        public
        view
        returns (uint256)
    {
        require(token != address(0), "Token Address cannot be zero");
        return Token(token).balanceOf(vaultAddress);
    }

    function numberOfVaults() public view returns (uint256) {
        return vaultCount;
    }

    function numberOfTransactions() public view returns (uint256) {
        return transactionCount;
    }

